import Home from './Pages/Home';
import {Router, Route, browserHistory, IndexRoute} from 'react-router';
import './App.css';

function App() {
  return (
  	<Router history={browserHistory}>
  		<Route path={'/'} component={Home}>
    	</Route>
    </Router>
  );
}

export default App;
